    "esExplanation": "Las paperas son una enfermedad infecciosa viral causada por el virus de las paperas. Causa una hinchazón dolorosa de las glándulas salivales, especialmente la parótida, además de fiebre y dolores de cabeza. Las complicaciones pueden incluir meningitis y orquitis en hombres.",
