    "frExplanation": "Tetanos, également appelé tétanos, est une maladie infectieuse bactérienne provoquée par Clostridium tetani. Les symptômes comprennent une raideur musculaire et des crampes. La maladie peut être mortelle, en particulier lorsque les muscles respiratoires sont touchés.",
    "plExplanation": "Tężec, znany również jako sztywność karku, to bakteryjna choroba zakaźna, wywoływana przez Clostridium tetani. Objawy obejmują sztywność mięśni i skurcze. Choroba może być śmiertelna, szczególnie gdy dotknięte są mięśnie oddechowe.",
