    "deExplanation": "Eine bakterielle Infektionskrankheit, die durch das Bakterium Yersinia pestis verursacht wird und oft durch Flohbisse von infizierten Tieren auf Menschen übertragen wird. Sie manifestiert sich klinisch typischerweise mit schmerzhaften, geschwollenen Lymphknoten (Bubonen), Fieber und Schüttelfrost. Die Beulenpest war im Mittelalter für mehrere Pandemien verantwortlich und kann unbehandelt tödlich verlaufen. Heute ist sie mit Antibiotika behandelbar.",
    "enExplanation": "Plague is a severe bacterial infectious disease caused by Yersinia pestis. It can manifest in three forms: bubonic, pneumonic, and septicemic plague. Typical symptoms include high fever, swollen lymph nodes, and severe systemic reactions.",
    "ukExplanation": "Чума - тяжке бактеріальне інфекційне захворювання, спричинене Yersinia pestis. Може мати три форми: бубонну чуму, легеневу чуму та септичну чуму. Типові симптоми включають високу лихоманку, набряк лімфовузлів та важкі системні реакції.",
