    "esExplanation": "La peste es una enfermedad infecciosa grave causada por Yersinia pestis. Puede presentarse en tres formas: peste bubónica, peste neumónica y peste séptica. Los síntomas típicos incluyen fiebre alta, inflamación de los ganglios linfáticos y reacciones sistémicas graves.",
    "frExplanation": "La peste est une grave maladie infectieuse bactérienne, provoquée par Yersinia pestis. Elle peut se présenter sous trois formes : peste bubonique, peste pulmonaire et peste septique. Les symptômes typiques comprennent une fièvre élevée, un gonflement des ganglions lymphatiques et de graves réactions systémiques.",
